import{_ as a,c as e,o as t,a as s}from"./app.71205104.js";const b='{"title":"Blue Jays","description":"","frontmatter":{},"relativePath":"birds/bluejay.md","lastUpdated":1641424629576}',i={},o=s('<h1 id="blue-jays" tabindex="-1">Blue Jays <a class="header-anchor" href="#blue-jays" aria-hidden="true">#</a></h1><p><em><strong>Cyanocitta cristata</strong></em></p><p>Size: 12&quot; (30 cm)</p><p>Male: Bright light blue and white bird with a black neckband and gray belly. Large crest moves up and down at will. White face, wing bars and tip of tail. Black tail bands.</p><p>Female: Same as male.</p><p>Juvenile: Same as adult, but duller.</p><p>Eggs: 4-5 eggs; green to blue with brown markings.</p><p>Migration: Non-migrator to partial migrator; will move around to find an abundant food source.</p><p>Food: Insects, fruit, carrion, seeds, nuts; will visit seed feeders and ground feeders with corn or peanuts.</p><div class="info custom-block"><p class="custom-block-title">Fun Facts!</p><p>Blue Jays are loud and noisy, and will mimic other birds.</p></div>',10),r=[o];function n(l,d,c,p,u,_){return t(),e("div",null,r)}var g=a(i,[["render",n]]);export{b as __pageData,g as default};
